  if(recievedstring=="Summarizing")
  {
    summarystring=recievedstring;

  }


  return (
    <>

<main>
  <span
    id="UnderOverlay"
      className="w-full h-full absolute opacity-100 bg-black"
  ></span>
  <div className="lg:pt-12 pt-6 w-full md:w-12/12 px-4 text-center">
    <div className="relative flex flex-col min-w-0 break-words bg-white w-full mb-8 shadow-lg rounded-lg">
      <div className="px-4 py-5 flex-auto">
        <h6 className="text-xl font-semibold">Summary of your Patent</h6>
        <p className="mt-2 mb-4 text-gray-600">
            <div>{summarystring}</div>
        </p>
      </div>
    </div>
  </div>

      </main>
    </>
  );
}
